import React from 'react';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import Chip from '@mui/material/Chip';
import AudiotrackIcon from '@mui/icons-material/Audiotrack';
export default function ComprehensiveReportDisplay({ report }) {
    if (!report) return null;

    // Parse model output and fallback
    const parsed = report.analysis_json ? report : null;
    const fields = parsed && parsed.analysis_json ? parsed.analysis_json : {};
    const fallback = report.parsedReport || {};

    // Statistics
    const violationCount = Array.isArray(fields.frame_analysis?.violation_categories)
        ? fields.frame_analysis.violation_categories.length
        : 0;
    const safeFrames = typeof fields.frame_analysis?.safe_frames === 'number' ? fields.frame_analysis.safe_frames : 0;
    const totalFrames = typeof fields.frame_analysis?.total_frames === 'number' ? fields.frame_analysis.total_frames : 0;
    const complianceRate = totalFrames > 0 ? Math.round((safeFrames / totalFrames) * 100) : 0;

    // Content extraction
    const transcript = fields.audio_analysis?.transcript || fields.transcript || fallback.transcript || '';
    const ocrText = fields.ocr_results?.text || fields.text_in_video?.text || fallback.ocr_text || '';
    const ocrItems = fields.ocr_results?.extracted_items || fields.text_in_video?.extracted_items || fallback.ocr_items || [];
    const blipDescriptions = fields.frame_analysis?.blip_descriptions || fallback.blip_descriptions || [];
    const copyrightCheck = report.copyright_check || null;

    // Transcript safety logic (define helpers)
    const badWords = fields.audio_analysis?.bad_words || [];
    const badPatterns = fields.audio_analysis?.bad_patterns || [];
    const isInappropriate = badWords.length > 0 || badPatterns.length > 0;
    let transcriptSafetyStatus = '';
    if (transcript === '') {
        transcriptSafetyStatus = 'No transcript available';
    } else if (isInappropriate) {
        if (badWords.length > 0) {
            transcriptSafetyStatus = 'Flagged: Inappropriate language detected';
        } else if (badPatterns.length > 0) {
            transcriptSafetyStatus = 'Close: Censored or partial inappropriate language detected';
        } else {
            transcriptSafetyStatus = 'Flagged: Inappropriate language detected';
        }
    } else {
        transcriptSafetyStatus = 'Safe: No inappropriate language detected';
    }

    return (
        <Box sx={{ width: '100vw', height: '100vh', background: '#f7f8fa', display: 'flex', flexDirection: 'column', justifyContent: 'flex-start', alignItems: 'stretch', m: 0, p: 0 }}>
            <Box sx={{ width: '100vw', height: '100vh', display: 'flex', flexDirection: 'row', gap: 4, alignItems: 'stretch', m: 0, p: 0 }}>
                {/* Left: Transcript Safety */}
                <Box sx={{ flex: 1, background: '#f5faff', borderRadius: 3, boxShadow: 2, p: 2, overflow: 'auto', height: '100%' }}>
                    <Card sx={{ boxShadow: 1, borderRadius: 2, mb: 2 }}>
                        <CardContent>
                            <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                                <AudiotrackIcon color="info" sx={{ fontSize: 28, mr: 1 }} />
                                <Typography variant="h6" sx={{ fontWeight: 'bold' }}>Transcript Safety (Model Output)</Typography>
                            </Box>
                            <Chip label={transcriptSafetyStatus} color={transcriptSafetyStatus.startsWith('Safe') ? 'success' : transcriptSafetyStatus.startsWith('Close') ? 'warning' : transcriptSafetyStatus.startsWith('No') ? 'warning' : 'error'} sx={{ fontWeight: 'bold', fontSize: 15, mb: 1 }} />
                            {isInappropriate && (badWords.length > 0 || badPatterns.length > 0) && (
                                <Typography variant="body2" sx={{ color: transcriptSafetyStatus.startsWith('Close') ? 'warning.main' : 'error.main', mt: 1 }}>
                                    {badWords.length > 0 && `Bad words: ${badWords.join(', ')}`}
                                    {badPatterns.length > 0 && `Close matches or censored forms detected.`}
                                </Typography>
                            )}
                        </CardContent>
                    </Card>
                    {/* Additional extracted content can be added here */}
                </Box>
                {/* Center: Model Analysis Report */}
                <Box sx={{ flex: 2, background: '#f8f8ff', borderRadius: 3, boxShadow: 2, p: 2, overflow: 'auto', height: '100%' }}>
                    <Card sx={{ boxShadow: 2, borderRadius: 2, mb: 2 }}>
                        <CardContent>
                            <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 2 }}>Frame Analysis</Typography>
                            <Typography variant="body2">Safe Frames: <b>{safeFrames}</b></Typography>
                            <Typography variant="body2">Total Frames: <b>{totalFrames}</b></Typography>
                            <Typography variant="body2">Compliance Rate: <b>{complianceRate}%</b></Typography>
                            <Typography variant="body2">Violations: <b>{violationCount}</b></Typography>
                        </CardContent>
                    </Card>
                    <Card sx={{ boxShadow: 2, borderRadius: 2, mb: 2 }}>
                        <CardContent>
                            <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 2 }}>Audio Analysis</Typography>
                            <Typography variant="body2">Transcript:</Typography>
                            <Typography variant="body2" sx={{ fontStyle: 'italic', mb: 1 }}>{transcript || 'No transcript available.'}</Typography>
                            <Typography variant="body2">Bad Words:</Typography>
                            {badWords.length > 0 ? (
                                <Box sx={{ mt: 1, display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                                    {badWords.map((word, idx) => (
                                        <Chip key={idx} label={word} color="warning" />
                                    ))}
                                </Box>
                            ) : (
                                <Typography variant="body2" color="success.main">None detected.</Typography>
                            )}
                            <Typography variant="body2">Bad Patterns:</Typography>
                            {badPatterns.length > 0 ? (
                                <Box sx={{ mt: 1, display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                                    {badPatterns.map((pat, idx) => (
                                        <Chip key={idx} label={pat} color="warning" />
                                    ))}
                                </Box>
                            ) : (
                                <Typography variant="body2" color="success.main">None detected.</Typography>
                            )}
                        </CardContent>
                    </Card>
                    <Card sx={{ boxShadow: 2, borderRadius: 2, mb: 2 }}>
                        <CardContent>
                            <Typography variant="h6" sx={{ fontWeight: 'bold', mb: 2 }}>Copyright Check</Typography>
                            <Typography variant="body2">Status: <b>{copyrightCheck?.status || 'N/A'}</b></Typography>
                            <Typography variant="body2">Details: <b>{copyrightCheck?.details || 'No details available.'}</b></Typography>
                        </CardContent>
                    </Card>
                </Box>
            </Box>
        </Box>
    );
}
